		'<h1 id="前言" tabindex="-1">前言 <a class="header-anchor" href="#前言" aria-label="Permalink to &quot;前言&quot;">​</a></h1><p>&quot;沉浸&quot;了一段时间，今天再次发博文，心情很是不一样；为什么会“沉浸”一段时间呢？</p><p>说来话长了, 本想着每个月发大约 4 篇博文总结，但是近期事情比较多，针对公司业务加班，赶进度，开发对应需求；每天晚上回来几乎都在 9.30 左右，在点个外卖，收拾 卫生，在洗个澡就差不多就 0.00 了，也就没什么时间发文章了；</p><p>在几年之前，也就是大约是在刚来上海的那 2 年左右吧，自己的大部分时间都是在学习工作技能，我本身就是前端开发人员，毕竟接触的范围和层次不同，才会花费大部分时间去学习。自己的很大精力都在自己的技术层面，知道最近慢慢回归生活了，最后才发现自己失去的时间太多。现在技术经过项目的沉淀，现在慢慢回归生活，才发现好好生活，自己的状态慢慢回到了正轨’</p><h2 id="放松-旅游" tabindex="-1">放松-旅游 <a class="header-anchor" href="#放松-旅游" aria-label="Permalink to &quot;放松-旅游&quot;">​</a></h2><p>在今年国庆前后去了躺乌镇，也当时放松，同时满足自己的旅游梦；</p><p>这次旅游提出者呢，不出意外的话就是我提出的，起初是在抖音上看见徐州小吃街的小吃，嘴瘾就上来了，然后就在微信上跟朋友说：“一周一座城”。然后简单霸气的回了我一个字：”走“；说走咱就走，就喜欢这么直接的，然后过了俩天就直接拉个小群，一共三人，就开始这部署周六日的旅游计划；</p><p>因为时间很紧张，所以直接来了一个说走就走的旅行，就把时间定了下来，周六中午就出发；朋友开车，前一天说车轮被钉子扎了，可能去不了，我们赶紧就买了周六下午的票，虹桥火车站出发，到了第二天朋友吧车票退了说是车胎好了，然后我就问了一下具体出发时间，趁着这段时间把家里卫生收拾一下；</p><p>下午朋友开车到了我小区，然后直接开启了俩天一夜的乌镇一游；</p><p>下午的时候就到了<strong>北栅</strong>, 到了之后，短暂休息了片刻，晚上就直接去了北栅，北栅就是一个风俗文化的地方，顺带在附近吃了个饭；</p><p>第二天朋友就直接开车去了<strong>南栅</strong>，南栅是一个历史建筑，里面有很多历史故事，还有许多景点，当然也吃了个饭； 不过那个饭真的不错，羊肉面肥而不腻，入口即化，就是景区价格有点贵；</p><p><img src="https://file.wangzevw.com/images/070A2001.JPG" alt="1"></p><p><img src="https://file.wangzevw.com/images/7684aa5598222e4fb6c5da1242264e4.jpg" alt="2"></p><p><img src="https://file.wangzevw.com/images/b37a9bfe7b4035aa9d1ab5db5ce15b1.jpg" alt="3"></p><p><img src="https://file.wangzevw.com/images/d1d7945f6766e3f554b884bc5848342.jpg" alt="4"></p><p><img src="https://file.wangzevw.com/images/7cd6c95e5777a0389c48f44694c9d7d.jpg" alt="5"></p><p><img src="https://file.wangzevw.com/images/9e8609733f4a8658f2519b47df068f9.jpg" alt="6"></p><p>玩耍时间很短，心情很爽，路上的时候也是随手拍了几张照片，要说照片肯定比不上专业设备 metz，不过拍出来的照片也挺好看的；朋友分享的照片我保存在网盘上了，文件太大了，普通设备还不行这一下估计 7 个 G 左右的内容，里面有图片，有文艺的作品等等；</p><p><strong>链接: <a href="https://pan.baidu.com/s/1SDKkbyALTTqeKsdNmFSdOA" target="_blank" rel="noreferrer">https://pan.baidu.com/s/1SDKkbyALTTqeKsdNmFSdOA</a> 提取码: nryb 复制这段内容后打开百度网盘手机 App，操作更方便哦</strong></p>',
